import React from 'react';
import SearchInput from './SearchInput';
const NavBar = () => {
    return (
        <div className="bg-blacked flex place-content-between h-24 flex-row items-center ">
                <h1 className="text-3xl text-gray-200 font-bold mb-5 mr-16">
                    Netfl'IF
                </h1>
                <div>
                    <SearchInput/>     
                </div>           
        </div>
    );
}

export default NavBar;
